- input: "TEXT\x1CC00136457\x1C1\x1C\x1CF3XA\x1CThis amended report is in response
    to the Request for Additional Information (RFAI) dated December 28th, 2012.  A
    refund to Republican Mainstreet Partnership PAC has been sent and will be reported
    on the 2012 Year End FEC report.  The memo entries in question in item 2 have
    been more clearly associated with corresponding itemized transactions.  As requested
    in item 3, more detailed description for event costs is included in this amendment.
    \ Payments were not made from transfers in from the national committee to specifically
    fund this activity.  Payments for mail and campaign materials reported on Schedule
    B for line 30(b) were materials used in exempt volunteer activity, and thus are
    appropriately reported on that schedule.  Purpose descriptions have been amended
    to include the identity of candidates supported through these exempt volunteer
    activities.  No employee whose salary or benefits appears on schedule H4 spent
    more than 25 percent of their compensated time on Federal Election Activity this
    month.\n"
